export function isOk(v) {
    return v.ok;
}
export function createOk(val) {
    var r = {
        ok: true,
        val: val,
        err: undefined,
    };
    return r;
}
export function isErr(v) {
    return !v.ok;
}
export function createErr(err) {
    var r = {
        ok: false,
        val: undefined,
        err: err,
    };
    return r;
}
